import React from 'react';
import DataAdvice from "./DataAdvice"

const Advice = () => {
    return (
        <>
         <section className="advice_container container-fluid">
           <div className="advice_box col-md-4 col-10">
           {
            DataAdvice.map((crnVal) =>{
                return(
                    <>
                    <a href="">
               <div className="img_data">
               <div class="article-overlay">{}
               <img src={crnVal.img} alt=""/>
               </div>
               </div>
               </a>
                    </>
                )
            })
           }
           <div class="article-overlay">Top 4 Web Design Strategies To Grow Your Business</div>
           </div>
         </section>

        
        </>
    )
}

export default Advice;
